import React from "react";

export default function SkillList(props) {
  return (
    <div class="skills-info skills-first-style">
      {props.items.map((item) => {
        return (
          <div key={uuidv4()} class="clearfix">
            <h4>{item}</h4>{" "}
          </div>
        );
      })}
    </div>
  );
}
